import React, { useState } from 'react';
import { Layout as AntLayout, Menu, Button, Avatar, Dropdown, Typography } from 'antd';
import { 
  DashboardOutlined, 
  CloudServerOutlined, 
  ExperimentOutlined,
  UserOutlined,
  LogoutOutlined,
  MenuFoldOutlined,
  MenuUnfoldOutlined,
  RocketOutlined,
  QuestionCircleOutlined,
  CalendarOutlined,
  BellOutlined,
  SettingOutlined,
  BarChartOutlined,
  FileTextOutlined,
  UploadOutlined
} from '@ant-design/icons';
import { useNavigate, useLocation } from 'react-router-dom';

const { Title } = Typography;

const { Header, Sider, Content } = AntLayout;

interface LayoutProps {
  children: React.ReactNode;
}

const Layout: React.FC<LayoutProps> = ({ children }) => {
  const [collapsed, setCollapsed] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  const menuItems = [
    {
      key: '/load-generators',
      icon: <UploadOutlined />,
      label: 'Load Data',
    },
    {
      key: '/',
      icon: <BarChartOutlined />,
      label: 'Data Explorer',
    },
    {
      key: '/notebooks',
      icon: <FileTextOutlined />,
      label: 'Notebooks',
    },
    {
      key: '/dashboards',
      icon: <DashboardOutlined />,
      label: 'Dashboards',
    },
    {
      key: '/test-management',
      icon: <CalendarOutlined />,
      label: 'Tasks',
    },
    {
      key: '/alerts',
      icon: <BellOutlined />,
      label: 'Alerts',
    },
    {
      key: '/settings',
      icon: <SettingOutlined />,
      label: 'Settings',
    },
  ];

  const userMenuItems = [
    {
      key: 'profile',
      icon: <UserOutlined />,
      label: '个人资料',
    },
    {
      key: 'logout',
      icon: <LogoutOutlined />,
      label: '退出登录',
    },
  ];

  const handleMenuClick = ({ key }: { key: string }) => {
    navigate(key);
  };

  const handleUserMenuClick = ({ key }: { key: string }) => {
    if (key === 'logout') {
      // 处理退出登录
      console.log('退出登录');
    }
  };

  return (
    <AntLayout style={{ minHeight: '100vh', background: 'var(--bg-primary)' }}>
      <Sider 
        trigger={null} 
        collapsible 
        collapsed={collapsed}
        style={{
          background: '#1a1d29',
          borderRight: 'none',
          display: 'flex',
          flexDirection: 'column',
          width: collapsed ? 80 : 240,
          minWidth: collapsed ? 80 : 240,
          maxWidth: collapsed ? 80 : 240
        }}
      >
        {/* Logo区域 */}
        <div style={{ 
          height: 64, 
          display: 'flex', 
          alignItems: 'center', 
          justifyContent: collapsed ? 'center' : 'flex-start',
          padding: collapsed ? '0' : '0 20px',
          borderBottom: '1px solid #2d3748'
        }}>
          {collapsed ? (
            <div style={{
              width: 32,
              height: 32,
              background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
              borderRadius: '8px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              color: '#fff',
              fontSize: '16px',
              fontWeight: 'bold'
            }}>
              P
            </div>
          ) : (
            <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
              <div style={{
                width: 32,
                height: 32,
                background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
                borderRadius: '8px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                color: '#fff',
                fontSize: '16px',
                fontWeight: 'bold'
              }}>
                P
              </div>
              <span style={{
                color: '#fff',
                fontSize: '18px',
                fontWeight: 600,
                fontFamily: 'system-ui, -apple-system, sans-serif'
              }}>
                pfp™
              </span>
            </div>
          )}
        </div>

        {/* 用户信息区域 */}
        <div style={{
          padding: collapsed ? '16px 8px' : '16px 20px',
          borderBottom: '1px solid #2d3748'
        }}>
          {collapsed ? (
            <div style={{
              width: 40,
              height: 40,
              background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
              borderRadius: '8px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              color: '#fff',
              fontSize: '16px',
              fontWeight: 'bold',
              margin: '0 auto'
            }}>
              A
            </div>
          ) : (
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '12px',
              padding: '12px',
              background: '#2d3748',
              borderRadius: '8px',
              cursor: 'pointer',
              transition: 'all 0.2s ease'
            }}>
              <div style={{
                width: 40,
                height: 40,
                background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
                borderRadius: '8px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                color: '#fff',
                fontSize: '16px',
                fontWeight: 'bold'
              }}>
                A
              </div>
              <div>
                <div style={{ color: '#e2e8f0', fontSize: '14px', fontWeight: 500 }}>admin</div>
                <div style={{ color: '#a0aec0', fontSize: '12px' }}>pfp</div>
              </div>
            </div>
          )}
        </div>

        {/* 主菜单区域 */}
        <div style={{ padding: '16px 0', flex: 1 }}>
          {menuItems.map(item => (
            <div
              key={item.key}
              onClick={() => handleMenuClick({ key: item.key })}
              style={{
                display: 'flex',
                alignItems: 'center',
                padding: collapsed ? '12px 20px' : '12px 20px',
                color: location.pathname === item.key ? '#fff' : '#a0aec0',
                cursor: 'pointer',
                transition: 'all 0.2s ease',
                background: location.pathname === item.key ? '#2d3748' : 'transparent',
                margin: '2px 0',
                borderRadius: '0 8px 8px 0',
                marginRight: '8px'
              }}
            >
              <span style={{ fontSize: '16px', minWidth: '20px' }}>{item.icon}</span>
              {!collapsed && <span style={{ marginLeft: '12px', fontSize: '14px', fontWeight: 500 }}>{item.label}</span>}
            </div>
          ))}
        </div>

        {/* 底部区域 */}
        <div style={{ 
          padding: '16px 0',
          borderTop: '1px solid #2d3748'
        }}>
          {/* Help & Support */}
          <div
            onClick={() => console.log('Help & Support')}
            style={{
              display: 'flex',
              alignItems: 'center',
              padding: collapsed ? '12px 20px' : '12px 20px',
              color: '#a0aec0',
              cursor: 'pointer',
              transition: 'all 0.2s ease',
              margin: '2px 0',
              borderRadius: '0 8px 8px 0',
              marginRight: '8px'
            }}
          >
            <span style={{ fontSize: '16px', minWidth: '20px' }}><QuestionCircleOutlined /></span>
            {!collapsed && <span style={{ marginLeft: '12px', fontSize: '14px', fontWeight: 500 }}>Help & Support</span>}
          </div>

          {/* 展开/收缩按钮 */}
          <div style={{ 
            display: 'flex',
            justifyContent: 'center',
            padding: '8px 0'
          }}>
            <Button
              type="text"
              icon={collapsed ? <MenuUnfoldOutlined /> : <MenuFoldOutlined />}
              onClick={() => setCollapsed(!collapsed)}
              style={{ 
                fontSize: '14px', 
                width: 32, 
                height: 32,
                color: '#a0aec0',
                background: 'transparent',
                border: '1px solid #2d3748',
                borderRadius: '6px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center'
              }}
            />
          </div>
        </div>
      </Sider>
      <AntLayout>
        <Header style={{ 
          padding: '0 24px', 
          background: 'var(--bg-secondary)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'flex-end',
          borderBottom: '1px solid var(--border)'
        }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: 16 }}>
            <span style={{ 
              color: 'var(--text-muted)', 
              fontSize: '12px', 
              fontWeight: 500,
              textTransform: 'uppercase',
              letterSpacing: '0.5px'
            }}>
              Performance Platform v1.0
            </span>
            <Dropdown
              menu={{ 
                items: userMenuItems,
                onClick: handleUserMenuClick
              }}
              placement="bottomRight"
            >
              <Avatar 
                icon={<RocketOutlined />} 
                style={{ 
                  cursor: 'pointer',
                  background: 'var(--primary)',
                  border: '1px solid var(--border)'
                }}
              />
            </Dropdown>
          </div>
        </Header>
        <Content style={{ 
          margin: 0, 
          minHeight: 280,
          background: 'var(--bg-primary)',
          padding: '24px'
        }}>
          {children}
        </Content>
      </AntLayout>
    </AntLayout>
  );
};

export default Layout;
